INSERT INTO `v1_65096f13900a0151be212a4036f5c2a00f281c93e9fad444a00e194a05f36dd2` VALUES (5, 3001, 0, 3, 1, 1, 2, 7, 12300152, 4.19, "はいお疲れ～\n点数的にはまあまあってとこね！\nま、超難問だし頑張ったわよ", "vo_minigame_1012_result_1084", 9);
